/**
 * Get table specific information from the infolist or descriptor
 * \param info Table to update
 * \param err  ObitErr for reporting errors.
 */
static void ObitTableGBTPARCRYOUpdate (ObitTableGBTPARCRYO *in, ObitErr *err)
{
  olong i;
  ObitTableDesc *desc;
   

 /* error checks */
   g_assert(ObitErrIsA(err));
  if (err->error) return;
  g_assert (ObitIsA(in, &myClassInfo));

  /* Get Keywords */

  /* initialize column numbers/offsets */
  in->timestampOff = -1;
  in->timestampCol = -1;
  in->valueOff = -1;
  in->valueCol = -1;
  in->descOff = -1;
  in->descCol = -1;
  /* Find columns and set offsets */
  desc = in->myDesc;
  if (desc->FieldName) {
    for (i=0; i<desc->nfield; i++) {
      if (!strncmp (desc->FieldName[i], "TimeStamp ", 10)) {
	 in->timestampOff = desc->offset[i];
 	 in->timestampCol = i;
      }
      if (!strncmp (desc->FieldName[i], "Value     ", 10)) {
	 in->valueOff = desc->offset[i];
 	 in->valueCol = i;
      }
      if (!strncmp (desc->FieldName[i], "Desc      ", 10)) {
	 in->descOff = desc->offset[i];
 	 in->descCol = i;
      }
     }
  }

  Obit_return_if_fail((in->timestampOff > -1), err,
       "ObitTableCryoUpdate: Could not find column timestamp");
  Obit_return_if_fail((in->valueOff > -1), err,
       "ObitTableCryoUpdate: Could not find column value");
} /* end ObitTableGBTPARCRYOUpdate */

/**
 * Copy table specific (keyword) information  to infolist.
 * \param info Table to update
 * \param err  ObitErr for reporting errors.
 */
static void ObitTableGBTPARCRYODumpKey (ObitTableGBTPARCRYO *in, ObitErr *err)
{
  ObitInfoList *info=NULL;

 /* error checks */
   g_assert(ObitErrIsA(err));
  if (err->error) return;
  g_assert (ObitIsA(in, &myClassInfo));

  /* Set Keywords */
  if (in->myIO!=NULL) info = ((ObitTableDesc*)(in->myIO->myDesc))->info;
  else info = in->myDesc->info;
   
} /* end ObitTableGBTPARCRYODumpKey */
